INSERT INTO `product` (`id`, `slug`, `type`, `title`, `description`, `tags`, `difficulty`, `duration`, `image`, `img_sm`, `img_md`, `img_lg`, `path`, `price`, `status`, `is_free`, `is_deleted`, `deleted_at`, `created_at`, `updated_at`) VALUES
	(1, 'php-punch-in-the-face', 'course', 'PHP Punch in the Face', '<p>\r\n    So you don\'t know PHP but want to? This Learn PHP Online course takes you from a <strong>complete newbie</strong> to an <strong>intermediate programmer</strong>. I\'ll walk you through the language basics and teach you to the most obvious thing you\'ll want to do: <strong>Build a Database Driven Project</strong>. This Learn PHP Online course should take no more than 2 weeks to finish.\r\n</p>\r\n<p>\r\n You should take this PHP For Absolute Beginners course because one language can open the door to opportunity, hobbies, and new languages. <strong>Studying programming was one of the best choices I made in life</strong>.\r\n</p>\r\n<p>\r\n  Take this ultimate PHP For Absolute Beginners course right now and learn PHP online.\r\n</p>', NULL, 1, 21960, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/php-punch-in-the-face-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/php-punch-in-the-face-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/php-punch-in-the-face-lg.jpg', 'php-punch-in-the-face', 29.95, 'published', 0, 0, NULL, NULL, NULL),
	(2, 'php-codeigniter', 'course', 'PHP CodeIgniter', '<p>\r\n    Learn Codeigniter - the most popular PHP Framework! In this course you will build a complete application in the CodeIgniter Framework from the ground up. You\'ll learn how  the MVC pattern works as I take you step-by-step through everything needed get fluent in CodeIgniter.\r\n</p>\r\n<p>\r\n   Some features in our application will be a personalized dashboard for any user who registers and logs in. We\'ll have AJAX publishing for all of our Todo Lists and Note\'s.\r\n</p>\r\n<p>\r\n We will be diving deep into JavaScript using jQuery to organize a custom Template and Event structure. Lastly, we\'ll polish off the dashboard with Twitter Bootstrap.\r\n</p>\r\n<p>\r\n   You\'ll understand how to expand upon these features when we are complete.\r\n</p>\r\n<p>\r\n   This course will take you to an Intermediate PHP programmer with some intermediary skills in JavaScript.\r\n</p>', NULL, 3, 25260, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/php-codeigniter-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/php-codeigniter-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/php-codeigniter-lg.jpg', 'php-codeigniter', 29.95, 'published', 0, 0, NULL, NULL, NULL),
	(3, 'python-for-rookies', 'course', 'Python for Rookies', '<p>\r\nYou should learn this language! Python is one of the fastest growing languages, it\'s even renowned as the language of the decade. You can use Python on any operating system to build whatever you like, including but not limited to GUI Applications, Web Applications, and Console Applications.\r\n</p>\r\n<p>\r\nI\'ll teach you how this seemingly strange language is actually quite simple. We cover the fundamentals to writing Python code from Syntax, Datatypes, Operators, and Looping. We\'ll even take a look into 3rd party package management!\r\n</p>', NULL, 1, 11640, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/python-for-rookies-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/python-for-rookies-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/python-for-rookies-lg.jpg', 'python-for-rookies', 19.95, 'published', 0, 0, NULL, NULL, NULL),
	(4, 'dream-in-javascript', 'course', 'Dream in JavaScript', '<p>\r\n    <strong> JavaScript is only scary from the outside</strong>. In this course you\'ll learn the basics of stand-alone JavaScript and how to integrate the most popular framework ever, <strong>jQuery</strong>. With the basic training I give you, you will be able to open up a new world of exploration.\r\n</p>\r\n<p>\r\n     This is a short series geared towards the beginners who are looking for some thinking juice. It\'s hard to get that first boost of motivation, but if you force yourself through a few examples you\'ll start dreaming about JavaScript and eventually getting good at it!\r\n</p>\r\n<p>\r\n   Let\'s go on a short journey and learn a treasure!\r\n</p>', NULL, 2, 12780, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/dream-in-javascript-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/dream-in-javascript-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/dream-in-javascript-lg.jpg', 'dream-in-javascript', 14.95, 'published', 0, 0, NULL, NULL, NULL),
	(5, 'phalcon-php', 'course', 'Phalcon PHP', '<p>\r\n      In this course I will teach you from the ground floor how to build an application in PHP\'s fastest full-scale framework; <strong>PhalconPHP</strong>. Controllers, Views, Routes, Templates, Models/Relationships/ORM; <strong>All covered.</strong>\r\n</p>\r\n<p>\r\n   Each section is broken down for you to follow along with and write code as I do. After learning as you go, we\'ll create a project based on what you\'ve learned.\r\n</p>\r\n<p>\r\n     We will make changes to the Bootstrap through each step in this<strong> follow-along series</strong> so you know exactly what\'s going on. This course is geared towards the medium to advanced skilled developer who have a well rounded knowledge of PHP and Object Oriented Design.\r\n</p>\r\n<p>\r\n   This course should take you around 2-3 weeks to complete, but you may need to come back a few times in order to absorb all the material. You should consider taking this course if you are interested in advanced development and bleeding-edge technology that will dominate PHP.\r\n</p>', NULL, 4, 21060, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/phalcon-php-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/phalcon-php-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/phalcon-php-lg.jpg', 'phalcon-php', 24.95, 'published', 0, 0, NULL, NULL, NULL),
	(6, 'professional-php-development', 'course', 'Professional PHP Development', '<p>Planned, Not Ready Yet!</p>', NULL, 5, 0, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/professional-php-development-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/professional-php-development-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/professional-php-development-lg.jpg', 'professional-php-development', 0.00, 'planned', 0, 1, NULL, NULL, NULL),
	(7, 'git-basics', 'course', 'Git Basics', '<p>This is a mini series which every developer should take. You will learn the basics of git usage inside the terminal. This is useful when you need to move a repo from local to development.</p>', NULL, 2, 1860, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/git-basics-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/git-basics-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/git-basics-lg.jpg', 'git-basics', 0.00, 'published', 1, 1, NULL, NULL, NULL),
	(8, 'fresh-start-html-css', 'course', 'Fresh Start HTML & CSS', '<p>Learn the foundational skills to start working with the web.</p>', NULL, 1, 11520, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/fresh-start-html-css-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/fresh-start-html-css-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/fresh-start-html-css-lg.jpg', 'fresh-start-html-css', 9.95, 'published', 0, 0, NULL, NULL, NULL),
	(9, 'redis', 'course', 'Redis', '<p>Redis is a powerful in-memory database. You could liken it to memcached yet with better data type handling. You may find yourself using Redis as a medium to process vast amounts of data.</p><p>Other examples may be using Redis for real-time chat logging, scoreboards, or simply a powerful caching engine.</p><p>This series is simple, we go through the Data Type and Commands, and you follow by example. We\'ll also integrate a PHP and Python client to show how easy it is to use as an abstracted adapter in two popular languages.</p> <p>It\'s highly encouraged you use <b>SSH</b> or <b>Linux</b> to use the Redis CLI. The Windows binary works but it can be a bit unstable.</p> <p>This course will guide you through the commands (Not every single one), but it will get you started so that it makes sense.</p>', NULL, 3, 6060, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/redis-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/redis-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/redis-lg.jpg', 'redis', 9.95, 'published', 0, 0, NULL, NULL, NULL),
	(10, 'virtualbox', 'course', 'How to use VirtualBox', '<p>Have you ever wanted to run another OS on your own? Virtualbox is one fantastic option. This course will take you through the basic features of using VirtualBox. You\'ll see how to use Linux through a Windows OS, and Windows inside of Linux Ubuntu. We will cover some of the features used and have an appreciation for this free software at the end. ', NULL, 1, 2220, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/virtualbox-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/virtualbox-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/virtualbox-lg.jpg', 'virtualbox', 0.00, 'published', 1, 1, NULL, NULL, NULL),
	(11, 'learn-django', 'course', 'Learn Django', '<p>This course teaches you how to build applications in Django. It is currently in development.</p>', NULL, 3, 0, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/learn-django-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/learn-django-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/learn-django-lg.jpg', 'learn-django', 0.00, 'planned', 0, 1, NULL, NULL, NULL),
	(12, 'ubuntify', 'course', 'Learn the Basics of Ubuntu Linux', '<p>This teaches you how to take command of the free open source Ubuntu, it is in development.</p>', NULL, 2, 0, NULL, 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/ubuntify-sm.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/ubuntify-md.jpg', 'https://d2qmoq5vnrtrov.cloudfront.net/img/product/ubuntify-lg.jpg', 'ubuntify', 0.00, 'planned', 0, 1, NULL, NULL, NULL);
