	(80, 2, '8.1-crud-get', NULL, NULL, 8, 1, 'We are going to Abstract the Active-Record and build out a re-usable CRUD model and begin with the GET ability. This will make queries and models a lot more convenient.', 26, 0, NULL, NULL, NULL),
	(81, 2, '8.2-crud-insert-delete', NULL, NULL, 8, 2, 'Add the INSERT ability to the CRUD model in a very simple manner.', 27, 0, NULL, NULL, NULL),
	(82, 2, '8.3-crud-update', NULL, NULL, 8, 3, 'The CRUD model needs an UPDATE ability, this is the hardest part.', 28, 0, NULL, NULL, NULL),
	(83, 2, '8.4-refactor-api-with-crud', NULL, NULL, 8, 4, 'We\'ll clean up our Code and you can download the final results.', 29, 0, NULL, NULL, NULL),
	(84, 2, '9.1-php-and-js-to-list', NULL, NULL, 9, 1, 'Following our pattern with the TODO items, we\'ll now do it with NOTE\'s. We\'ll use the same API controller and set everything up to list our notes out.', 30, 0, NULL, NULL, NULL),
	(85, 2, '9.2-prepare-for-updating-notes', NULL, NULL, 9, 2, 'We want a form to edit existing notes, so we modify quite a bit of JavaScript to and build a template for this.', 31, 0, NULL, NULL, NULL),
	(86, 2, '9.3-save-note-update-p1', NULL, NULL, 9, 3, 'This is a very difficult portion of the JavaScript. It\'s split into two parts. If you have a lot of trouble following along, you can download the Additional Content right after "Note Updates PT 2" which contains the whole project file if you\'d like to check your code.', 32, 0, NULL, NULL, NULL),
	(87, 2, '9.4-save-note-update-p2', NULL, NULL, 9, 4, 'Here we wrap up the saving of notes. The two update parts were difficult so I\'ve included a ZIP file if you cannot get yours working.', 33, 0, NULL, NULL, NULL),
	(88, 2, '9.5-delete-note', NULL, NULL, 9, 5, 'We\'ll easily add the ability to DELETE notes via ajax.', 34, 0, NULL, NULL, NULL),
	(89, 2, '9.6-create-dynamic', NULL, NULL, 9, 6, 'When we insert our records we never want to refresh the page, so we add this in. We also toss in an AJAX loader so it looks busy.', 35, 0, NULL, NULL, NULL),
	(90, 2, '9.7-code-cleanup', NULL, NULL, 9, 7, 'Here we clean up some of our DOM code and tidy it all up. You can download the entire project progress in the following ZIP file.', 36, 0, NULL, NULL, NULL),
	(91, 2, '10.1-bootstrap-forms', NULL, NULL, 10, 1, 'Learn what Scaffolding is, it\'s quite simple. We\'ll decorate our forms to look a lot nicer.', 37, 0, NULL, NULL, NULL),
	(92, 2, '10.2-bootstrap-todo-p1', NULL, NULL, 10, 2, 'This entire time the TODO has look ugly, so we\'ll be using some custom CSS to make it look nice.', 38, 0, NULL, NULL, NULL),
	(93, 2, '10.3-bootstrap-todo-p2', NULL, NULL, 10, 3, 'We are now ready to finish off the TODO styling so people might actually use it! (Revised): I had to manually add the audio at 10 minutes as my mic gave out.', 39, 0, NULL, NULL, NULL),
	(94, 2, '10.4-bootstrap-notes', NULL, NULL, 10, 4, 'We style the Notes area and start to polish off the project. ', 40, 0, NULL, NULL, NULL),
	(95, 2, '10.5-fixing-display-bugs', NULL, NULL, 10, 5, 'What\'s software without bugs? They are bound to happen. I address a few display issues and we\'ll fix them up!', 41, 0, NULL, NULL, NULL),
	(96, 2, '10.6-closing-remarks', NULL, NULL, 10, 6, 'Closing remarks regarding this project and a few tidbits that may be handy!', 42, 0, NULL, NULL, NULL),
	(97, 3, '1.1-installing-python', 1, 1, 1, 1, 'We will install Python 2.7 on Windows in this video, we then set the Environment Variable so that we can access it through any console on the system. Python comes pre-installed on Mac and Linux. You have to set the Environment Variable in Windows to use it in any console.', 1, 0, NULL, NULL, NULL),
	(98, 3, '1.2-grab-text-editor', 1, NULL, 1, 2, 'Pick your favorite text editor. Here are a few suggetsions!', 2, 0, NULL, NULL, NULL),
	(99, 3, '1.3-get-a-console', 1, NULL, 1, 3, 'You\'ll use a terminal to run your Python code, so get one you like! OSX and Linux already have one built in you can use.', 3, 0, NULL, NULL, NULL),
	(100, 3, '2.1-hello-world', 1, NULL, 2, 1, 'Here we setup our simple workspace with a text editor beside a console. We will begin our first Python Script with "Hello World". Let\'s also get a bit more comfortable with the command line.', 4, 0, NULL, NULL, NULL),
	(101, 3, '2.2-variables', 1, NULL, 2, 2, 'Variables are standard placeholders in every language, its no different with Python.', 5, 0, NULL, NULL, NULL),
	(102, 3, '2.3-playing-with-string', NULL, NULL, 2, 3, 'Learn some basics like connecting strings, formatting them and accessing characters within a string.', 6, 0, NULL, NULL, NULL),
	(103, 3, '2.4-playing-with-lists', NULL, NULL, 2, 4, 'We\'ll use some of what we\'ve learned from string and apply them to lists. You\'ll also learn to use your first methods to manipulate a list.', 7, 0, NULL, NULL, NULL),
	(104, 3, '2.5-playing-with-dictionaries', NULL, NULL, 2, 5, 'Time to move into Key/Value pairs with the Dictionary DataType. This is similar to arrays, but you\'ll see it the difference in the dictionary{} vs the list[] syntax. ', 8, 0, NULL, NULL, NULL),
	(105, 3, '2.6-immutable-types', NULL, NULL, 2, 6, '"TUPLES" are pretty much "LISTS", only with less functionality, faster processing speed (CPU-wise), and their values cannot be changed. This video covers the need to know when you encounter a tuple.', 9, 0, NULL, NULL, NULL),
	(106, 3, '2.7-conditions-and-comparisons', NULL, NULL, 2, 7, 'Conditionals simply compare your statements to evaluate if they are true. The things you\'ll learn are: if, else, elif, is, ==, and in.', 0, 0, NULL, NULL, NULL),
	(107, 3, '2.8-your-first-console-app', NULL, NULL, 2, 8, 'You\'ll create a very simple console application where you can insert your name. Then I\'ll show you how to keep the application running with a while loop. We\'ll do a simple age calculator and add 10 years to whatever age in inserted.', 0, 0, NULL, NULL, NULL),
	(108, 3, '3.1-while-loop', NULL, NULL, 3, 1, 'Create a while loop to count numbers. Learn how to print things out on an interval, and then learn how to break out of a while loop.', 0, 0, NULL, NULL, NULL),
	(109, 3, '3.2-for-loop', NULL, NULL, 3, 2, 'Learn the powerful for loop. You will use this all the time! We begin with a few practical examples: using the range() function and manually looping a list.', 0, 0, NULL, NULL, NULL),
	(110, 3, '3.3-nested-loops', NULL, NULL, 3, 3, 'Learn how to loop through nested lists and dictionaries. And the special iteritems() method to assist you.', 0, 0, NULL, NULL, NULL),
	(111, 3, '4.1-beginner-functions', NULL, NULL, 4, 1, 'Learn how to create re-usable functions in python. This helps you prevent code duplication.', 0, 0, NULL, NULL, NULL),
	(112, 3, '4.2-keyword-arguments', NULL, NULL, 4, 2, 'Go beyond standard arguments and use keyword arguments', 0, 0, NULL, NULL, NULL),
	(113, 3, '4.3-arbitrary-arguments', NULL, NULL, 4, 3, 'These are awesome! Arbitrary arguments and Arbitrary Key Word arguments.', 0, 0, NULL, NULL, NULL),
	(114, 3, '4.4-intermission', NULL, NULL, 4, 4, 'This is an intermission to talk briefly about programming and a few philosophies.', 0, 0, NULL, NULL, NULL),
	(115, 3, '5.1-class-structure-oop', NULL, NULL, 5, 1, 'Learn to build your first class. Create instances of a class with different properties.', 0, 0, NULL, NULL, NULL),
	(116, 3, '5.2-importing-system-modules', NULL, NULL, 5, 2, 'Learn the basics of importing from the Python Standard Library', 0, 0, NULL, NULL, NULL),
	(117, 3, '5.3-random-module', NULL, NULL, 5, 3, 'We get our hands dirty with a random module. Learn how to create random integers and floats quite easily.', 0, 0, NULL, NULL, NULL),
	(118, 3, '5.4-json-module', NULL, NULL, 5, 4, 'Learn how to easily use JSON the simplest serialization for passing data from string to objects and vice-versa.', 0, 0, NULL, NULL, NULL),
	(119, 3, '5.5-os-module', NULL, NULL, 5, 5, 'Learn a few tricks in the OS module to perform Operating System based tasks.', 0, 0, NULL, NULL, NULL),
	(120, 3, '6.1-pip-install-windows', NULL, NULL, 6, 1, 'Instructions on installing Pythons best Package manager in Windows.', 0, 0, NULL, NULL, NULL),
	(121, 3, '6.2-pip-install-linux', NULL, NULL, 6, 2, 'Instructions on installing Pythons best Package manager in Linux.', 0, 0, NULL, NULL, NULL),
	(122, 3, '6.3-virtual-environment-flask', NULL, NULL, 6, 3, 'Learn what VirtualEnvironment is and how to install and use it. We also install Flask, a library we we use shortly!', 0, 0, NULL, NULL, NULL),
	(123, 3, '6.4-flask-routes', NULL, NULL, 6, 4, 'Using flask you can easily build a site with URL mapping, I\'ll show you how to get started!', 0, 0, NULL, NULL, NULL),
	(124, 3, '6.5-flask-templates', NULL, NULL, 6, 5, 'Learn how to create a main layout, and use sub-templates to keep a whole site.', 0, 0, NULL, NULL, NULL),
	(125, 3, '6.5-python-code-to-views', NULL, NULL, 6, 6, 'Learn to pass data from the route to the view, and create a 404 Handler.', 0, 0, NULL, NULL, NULL),
	(126, 3, '6.7-handling-requests', NULL, NULL, 6, 7, 'Handle GET/POST requests, Redirects, and I mention a few other libraries you could utilize.', 0, 0, NULL, NULL, NULL),
	(127, 3, '6.8-closing-summary', NULL, NULL, 6, 8, 'What else is there to Python? A lot! Here are some other things you can look into, and this is only touching the surface!', 0, 0, NULL, NULL, NULL),
	(128, 3, '7.1-installing-fabric', NULL, NULL, 7, 1, 'How to install on Windows & Linux. Ill be using a Digital Ocean Account for the Linux Demo (See links for a $10 coupon if you want to use them)', 0, 0, NULL, NULL, NULL),
	(129, 3, '7.2-fabric-local-for-console-work', NULL, NULL, 7, 2, 'Learn how to run local commands to save time working with GIT terminal.', 0, 0, NULL, NULL, NULL),
	(130, 3, '7.3-fabric-to-server', NULL, NULL, 7, 3, 'Deploy to your server using GIT!', 0, 0, NULL, NULL, NULL),
	(131, 4, '1.1-choose-your-browser', 1, 1, 1, 1, 'You need a web browser to run JavaScript, I suggest Chrome because it has the best debugging tools.', 0, 0, NULL, NULL, NULL),
	(132, 4, '1.2-choose-your-text-editor', 1, NULL, 1, 2, 'You need a text editor like Sublime Text or Notepad++ to type your code.', 0, 0, NULL, NULL, NULL),
	(133, 4, '1.3-setup-a-project-folder', 1, NULL, 1, 3, 'Create a project folder to start our learning.', 0, 0, NULL, NULL, NULL),
	(134, 4, '2.1-strings', 1, NULL, 2, 1, 'Strings are simply lines of text, a name, a birthday, or anything contained in quotes.', 0, 0, NULL, NULL, NULL),
	(135, 4, '2.2-numbers-and-floats', NULL, NULL, 2, 2, 'Numbers are whole numbers like -1 or 5. Floats are decimal points, like 1.04.', 0, 0, NULL, NULL, NULL),
	(136, 4, '2.3-arrays', NULL, NULL, 2, 3, 'Arrays are actually Objects internally in JavaScript, but they behave differently. ', 0, 0, NULL, NULL, NULL),
	(137, 4, '2.4-objects', NULL, NULL, 2, 4, 'Objects are created with the {} braces and offer a world of options. You will use Objects and Arrays always!', 0, 0, NULL, NULL, NULL),
	(138, 4, '2.5-functions', NULL, NULL, 2, 5, 'Functions allow you repeat the same thing without redefining your code many times.', 0, 0, NULL, NULL, NULL),
	(139, 4, '3.1-whats-the-dom', NULL, NULL, 3, 1, 'An overview of the Document Object Model (DOM) and how it works like a Tree.', 0, 0, NULL, NULL, NULL),
	(140, 4, '3.2-selecting-elements', NULL, NULL, 3, 2, 'This is how you select elements using DOM selectors.', 0, 0, NULL, NULL, NULL),
	(141, 4, '3.3-playing-with-forms', NULL, NULL, 3, 3, 'We will tweak and toggle a few forms here.', 0, 0, NULL, NULL, NULL),
	(142, 4, '3.4-dom-manipulation', NULL, NULL, 3, 4, 'Traversal is moving throughout the tree. Just picture your $(selector) is a character, and now you have to navigate up a tree. That\'s exactly what traversing means!', 0, 0, NULL, NULL, NULL),
	(143, 4, '3.5-traversal', NULL, NULL, 3, 5, 'jQuery comes with some basic effects and animations. These is a demonstration of using them.', 0, 0, NULL, NULL, NULL),
	(144, 4, '3.7-ajax', NULL, NULL, 3, 7, 'Here\'s how you go about doing using AJAX! A webserver is required to do real AJAX calls -- this will teach you anyways!', 0, 0, NULL, NULL, NULL),
	(145, 4, '4.1-setup-underscore-js', NULL, NULL, 4, 1, 'Underscore is a nice toolbelt, here\'s how to get it loaded in our project.', 0, 0, NULL, NULL, NULL),
	(146, 4, '4.2-collections', NULL, NULL, 4, 2, 'Get the gist of how collections work, its extremely easy!', 0, 0, NULL, NULL, NULL),
	(147, 4, '4.3-array-playground', NULL, NULL, 4, 3, 'Make your life easier with these array utilities.', 0, 0, NULL, NULL, NULL),
	(148, 4, '4.4-templates-and-typeof-checking', NULL, NULL, 4, 4, 'Templates are very useful! See how easy they are to use.', 0, 0, NULL, NULL, NULL),
	(149, 4, '5.1-conclusion', NULL, NULL, 5, 1, 'This is a summary of what other frameworks are out there with a few thoughts on them.', 0, 0, NULL, NULL, NULL),
	(150, 5, '1.1-intro', 1, NULL, 1, 1, 'PhalconPHP is the fastest full-scale framework written in C for the Zend Engine.', 0, 0, NULL, NULL, NULL),
	(151, 5, '1.2-windows-installation', NULL, NULL, 1, 2, 'This demonstrates how to properly install Phalcon. It\'s similar to almost any MVC besides the extension adding. I\'ll show you how to create a Virtual Host to protect non-public files.', 0, 0, NULL, NULL, NULL),
	(152, 5, '1.3-linux-installation', NULL, NULL, 1, 3, 'How to Easily compile Phalcon inside Linux', 0, 0, NULL, NULL, NULL),
	(153, 5, '2.1-create-app-structure', NULL, NULL, 2, 1, 'We will create a directory structure like the Phalcon Documents use to stay consistent with them. Yet the option is still up to you to lay it out anyway you choose.\r\n\r\nI will also be using GIT for managing this project and I encourage you to if you know how to use it. The purpose of me bringing it up is so that you are not confused about any .git folders and files.', 0, 0, NULL, NULL, NULL),
	(154, 5, '2.2-create-bootstrap', NULL, NULL, 2, 2, 'The Bootstrap is the entry point for the application. This is where you define autoloading, view folders, and return data from the application.\r\n\r\nThe DependencyInjector is like a global registry using closures, it will become very useful in the future.\r\n\r\nAlthough a CLI application can generate this for us, it\'s important you understand what\'s going on.', 0, 0, NULL, NULL, NULL),
	(155, 5, '2.3-understand-controllers', NULL, NULL, 2, 3, 'Learn a few core items that are important for the Controller.\r\n\r\n- With the Dispatcher ($this->dispatch->forward) you can call another URL action (as if it were a function).\r\n\r\n- With the initialize() function, you can use it for protecting your Routes.\r\n\r\nCliff Notes:\r\n\r\n- initialize() is only called When a route is successfully loaded (beforeExecuteRoute)', 0, 0, NULL, NULL, NULL),
	(156, 5, '2.4-integrating-views', NULL, NULL, 2, 4, 'Learn how to render your views from controllers, and how to take advantage of layouts.\r\n\r\nImportant: If create /layout/login.phtml Phalcon will autoload for the login controller, so you do not need to call setTemplateAfter(\'login\') or it will load twice.\r\n\r\nView Render Levels\r\n\r\nhttp://docs.phalconphp.com/en/latest/api/Phalcon_Mvc_View.html', 0, 0, NULL, NULL, NULL),
	(157, 5, '3.1-create-database-schema', NULL, NULL, 3, 1, 'Follow along to create our database schema if you like. I will be using HeidiSQL (free), you may use your favorite SQL client.', 0, 0, NULL, NULL, NULL),
	(158, 5, '3.2-update-bootstrap-for-db', NULL, NULL, 3, 2, 'Place our database connection into the application using the Dependency Injector.', 0, 0, NULL, NULL, NULL),
	(159, 5, '3.3-model-setup-create-update-select', NULL, NULL, 3, 3, 'Learn how to Create, Update, and Select data.', 0, 0, NULL, NULL, NULL),
	(160, 5, '3.4-model-delete-data', NULL, NULL, 3, 4, 'Learn how to delete data permanently and soft deleting.', 0, 0, NULL, NULL, NULL),
	(161, 5, '3.5-model-events', NULL, NULL, 3, 5, 'Events can be used to add repetitive tasks to your query, validate data, or call out other methods.\r\n\r\nAdditionally there are these model methods: beforeDelete() and afterDelete();', 0, 0, NULL, NULL, NULL),
	(162, 5, '3.6-table-model-relationships', NULL, NULL, 3, 6, 'Learn how to associate your models with other tables. We will use the Model::hasMany() and Model::belongsTo().\r\n\r\nThere are two other features I won\'t be convering (hasOne and hasManyToMany), you can look those up in the docs (see link).', 0, 0, NULL, NULL, NULL),
	(163, 5, '3.7-saving-related-records', NULL, NULL, 3, 7, 'Easily add to another table with associated records with a few lines of code.\r\n\r\nI demonstrate the save() feature, but you can also use this for updating and deleting.', 0, 0, NULL, NULL, NULL),
	(164, 5, '4.1-install-apc-linux', NULL, NULL, 4, 1, 'APC is an "Alternative PHP Cache" library. This is how you install it on Debian/Ubuntu systems using PEAR.', 0, 0, NULL, NULL, NULL),
	(165, 5, '4.2-install-apc-windows', NULL, NULL, 4, 2, 'Here is how you install APC for usage on Windows inside of WAMP or XAMPP.\r\n\r\nMediaFire Link: For 64-Bit PHP (php_apc-3.1.13-5.4-VC9-x64.zip)\r\n\r\nPHP.net Link: For 32-Bit PHP (php_apc-3.1.10-5.4-vc9-x86.zip)\r\n\r\nNote: PHP Suggests using code compiled with VC9 over VC6 for increased performance.', 0, 0, NULL, NULL, NULL),
	(166, 5, '4.3-caching-meta-data', NULL, NULL, 4, 3, 'MetaData is a description of your SQL table to map it to your Model file in the ORM. It\'s going to save your server load time by caching your table meta-data so you do not waste query(s) on every model instantiation.', 0, 0, NULL, NULL, NULL),
	(167, 5, '4.4-using-sessions', NULL, NULL, 4, 4, 'Here\'s the standard Session usage in a nice wrapper.', 0, 0, NULL, NULL, NULL),
	(168, 5, '4.5-request-environment', NULL, NULL, 4, 5, 'How to use the request environment.', 0, 0, NULL, NULL, NULL),
	(169, 5, '4.6-custom-routing', NULL, NULL, 4, 6, 'There are a lot of features to the routes. I will show the basics\r\n\r\nand the two main options you might want to use.', 0, 0, NULL, NULL, NULL),
	(170, 5, '5.1-assets-manager-and-bootstrap', NULL, NULL, 5, 1, 'We will use the Assets manager briefly for loading Js or CSS into our views. Ill also show you the collections, and there are further options for minification you can find in the documents.\r\n\r\nWe\'ll also create a BaseController to make our project easier to manage with shared functionality when need-be.', 0, 0, NULL, NULL, NULL),
	(171, 5, '5.2-enable-volt', 1, NULL, 5, 2, 'The Volt template engine is quite snazzy and similar to Mustache or Jinja Templating. We just load up the one liner into our view injection and we are good to go.', 0, 0, NULL, NULL, NULL),
	(172, 5, '5.3-volt-syntax', NULL, NULL, 5, 3, 'The Volt Templating engine is extremely easy to use. I\'ll show you some basics as we rewrite our user view into Volt.', 0, 0, NULL, NULL, NULL),
	(173, 5, '6.1-application-overhaul', NULL, NULL, 6, 1, 'We begin our application titled "Fireball". We will do a major facelift and clean up a lot of the learning code, and setup a base template system while integrating Bootstrap 3. You may skip this video if you like and just download the code and continue, however, I recommend watching at the very least so you pickup some tricks.', 0, 0, NULL, NULL, NULL),
	(174, 5, '6.2-acl-p1', NULL, NULL, 6, 2, 'We begin setting up an ACL System (Access Control List). For Guests, Users, and Admins. there is a lot of code we type to set it up, so I have provided the files in case you make a mistake.', 0, 0, NULL, NULL, NULL),
	(175, 5, '6.3-acl-p2', NULL, NULL, 6, 3, 'Here we finish adding permissions to our ACL with our different groups. We run into a few kinks in the road, please just watch to get a few ideas on debugging. There is a lot of code to type so I\'ve provided the files incase you have any problems.', 0, 0, NULL, NULL, NULL),
	(176, 5, '6.4-flashing-and-namespaces', NULL, NULL, 6, 4, 'Learn how to flash data when a user isn\'t allowed somewhere. Then refactor some of our namespaces for cleanliness.', 0, 0, NULL, NULL, NULL),
	(177, 5, '7.1-create-a-login-area-tied-into-the-acl-p1', NULL, NULL, 7, 1, 'We begin to tie in the login form with the ACL and a user dashboard page.', 0, 0, NULL, NULL, NULL),
	(178, 5, '7.2-create-a-login-area-tied-into-the-acl-p2', NULL, NULL, 7, 2, 'We finish to tie in the login form with the ACL and a user dashboard page.', 0, 0, NULL, NULL, NULL),
	(179, 5, '7.3-securing-passwords-and-csrf', NULL, NULL, 7, 3, 'Use the security class for CSRF and Encrpyting Passwords. You need OpenSSL Enabled.', 0, 0, NULL, NULL, NULL),
	(180, 5, '7.4-user-registration', NULL, NULL, 7, 4, 'Cram Session to build out the registration in one sitting!', 0, 0, NULL, NULL, NULL),
	(181, 5, '8.1-config-object', NULL, NULL, 8, 1, 'A handy class to pass configurations around your system.', 0, 0, NULL, NULL, NULL),
	(182, 5, '10.1-conclusion', NULL, NULL, 10, 1, 'Summary of what youve learned!', 0, 0, NULL, NULL, NULL),
	(185, 5, 'promo', NULL, 1, NULL, NULL, NULL, 0, 0, NULL, NULL, NULL),
	(186, 5, '8.2-custom-components', NULL, NULL, 8, 2, 'Custom components are an elegant way to make re-usable code with access to all dependency inejected object.', 0, 0, NULL, NULL, NULL),
	(187, 5, '8.3-using-composer', NULL, NULL, 8, 3, 'Using Composer with Phalcon (Or any other system for that matter) is extremely simple, and it manages dependencies nicely!', 0, 0, NULL, NULL, NULL),
	(188, 4, '2.6-loops', NULL, NULL, 2, 6, 'Looping data is essential to every language.', 0, 0, NULL, NULL, NULL),
	(189, 5, '9.1-phalcon-vagrant-setup', NULL, NULL, 9, 1, '<code>\r\n$ sudo apt-get update\r\n$ sudo apt-get install -y python-software-properties\r\n$ sudo add-apt-repository ppa:ondrej/php5\r\n$ sudo apt-get update\r\n$ sudo apt-get install -y php5 php5-dev apache2 libapache2-mod-php5 mysql-server php5-mysql redis-server curl htop git-core\r\n\r\n$ git clone --depth=1 git://github.com/phalcon/cphalcon.git\r\n$ cd cphalcon/build\r\n$ sudo ./install\r\n\r\n$ vi /etc/php5/mods-available/phalcon.ini\r\n# Add: extension=phalcon.so\r\n$ sudo php5enmod phalcon\r\n\r\n$ cd ~\r\n$ sudo curl -sS https://getcomposer.org/installer | php\r\n$ sudo mv composer.phar /usr/local/bin/composer\r\n\r\n$ mkdir phalcon-tools\r\n\r\n$ nano composer.json\r\n# Add:\r\n{\r\n    "require": {\r\n        "phalcon/devtools": "dev-master"\r\n    }\r\n}\r\n\r\n$ composer install\r\n\r\n$ rm composer.json composer.lock\r\n$ mv vendor/phalcon/devtools/* phalcon-tools\r\n\r\n$ sudo ln -s ~/phalcon-tools/phalcon.php /usr/bin/phalcon\r\n</code>', 0, 0, NULL, NULL, NULL),
	(190, 5, '9.2-point-apache-setup-barebones', NULL, NULL, 9, 2, 'We point Apache to our own folder to work in.\r\nMake sure to disable the default site:\r\n\r\n<code>\r\n$ sudo a2dissite 000-default\r\n</code>\r\n\r\nThen enable the playground site after you create it with:\r\n\r\n<code>\r\n$ sudo a2ensite playground\r\n</code>\r\n\r\nMake sure mod-rewrite is on\r\n<code>\r\n$ sudo a2enmod rewrite\r\n</code>\r\n\r\nRestart apache\r\n<code>\r\n$ sudo service apache2 restart\r\n</code>\r\n\r\nHere is the code for our playground.conf\r\n\r\n<code>\r\n&lt;VirtualHost *:80&gt;\r\nDocumentRoot /vagrant/www/\r\n&lt;/VirtualHost&gt;\r\n\r\n&lt;Directory "/vagrant/www/"&gt;\r\n        Options Indexes FollowSymlinks\r\n        AllowOverride All\r\n        Require all granted\r\n&lt;/Directory&gt;\r\n</code>', 0, 0, NULL, NULL, NULL),
	(191, 5, '9.3-migrations', NULL, NULL, 9, 3, 'Migrations are used to update your database from local to production on the fly after making changes without having to do everything by hand or touch SQL code.', 0, 0, NULL, NULL, NULL),
	(192, 5, '9.4-scaffolding', NULL, NULL, 9, 4, 'Scaffolding creates a quick CRUD interface based on our database tables. It\'s a time saver that you can customize easily.', 0, 0, NULL, NULL, NULL),
	(193, 6, '1.1-intro', NULL, NULL, 1, 1, NULL, 0, 0, NULL, NULL, NULL),
	(194, 6, '2.1-part-1', NULL, NULL, 2, 1, NULL, 0, 0, NULL, NULL, NULL),
