	(242, 10, '1.1-virtual-box-download', NULL, NULL, 1, 1, 'Get started with VirtualBox, It\'s free, easy, and works on every OS.', 0, 0, NULL, NULL, NULL),
	(243, 10, '1.2-install-linux-on-windows', NULL, NULL, 1, 2, 'We\'ll install Linux inside of Windows to demonstrate the power of VirtualBox.', 0, 0, NULL, NULL, NULL),
	(244, 10, '1.3-install-guest-additions', NULL, NULL, 1, 3, 'Guest Additions allow the Guest Machine (Linux) to receive additional settings from the host (Windows).', 0, 0, NULL, NULL, NULL),
	(245, 10, '2.1-primary-settings', NULL, NULL, 2, 1, 'This is a quick breakdown of the main settings.', 0, 0, NULL, NULL, NULL),
	(246, 10, '3.1-virtualbox-linux', NULL, NULL, 3, 1, 'Here is an example of having many windows installations under Ubuntu. Please take note of the flag incase you need to set it in your terminal: <code>vboxmanage setextradata "The Box Name" VBoxInternal/CPUM/CMPXCHG16B 1</code>', 0, 0, NULL, NULL, NULL),
	(247, 9, '1.1-intro', 1, NULL, 1, 1, 'What is Redis and who uses it?', 0, 0, NULL, NULL, NULL),
