INSERT INTO `product_thread` (`id`, `product_id`, `user_id`, `title`, `content`, `content_code`, `is_deleted`, `deleted_at`, `created_at`, `updated_at`) VALUES
	(1, 2, 58, 'dashboard.js', 'Hi,\r\nDo I missing something beetween chapter 6.1 and 6.2, when the dashboard.js was created? and the controls in the dashboard_view.php?\r\nI tried to construct them from the source code, but get lost in the end of chapter 6.2. with an error in the dashboard.js constructor, with the line: \r\nResult = new Result()\r\nThe error message is: Uncaugth Typeerror: object is not a function.\r\nAny help is appreciated. Thanks\r\n', '', 0, NULL, '2014-03-02 02:37:15', NULL),
	(2, 5, 709, '3.3 Model - I cannot get anything into the db?', 'Hi,\nFollowed along to this point without any problems, but when creating the empty User model and the corresponding UserController, I can get nothing into the db. Am I missing something here?\nI have checked for typos of any kind, checked db-format etc and I\'m getting no errors in the print_r( "$user->getMessages()" ) statement. Just nothing happening in the db. Am I right in assuming, that simply creating an empty User model and referencing the db through a corresponding controller, the naming alone will make all the magic happen?', NULL, 0, NULL, '2014-04-26 22:11:09', NULL),
	(8, 2, 556, '500 Internal Server Error', 'I have downloaded ur sourcecode, but I an error, and chrome say it is: POST - 500 Internal Server Error, when I completed the form. I used google chrome to loacted the error. You are free to tried at http://vuc.esy.es/ - I havent change anything in the code beside of DB-information.', NULL, 0, NULL, '2014-04-28 16:17:17', NULL),
	(9, 5, 709, '6.1 video not working?', 'I get to download a file called 173 when I click the video link for 6.1 Application overhaul.', NULL, 0, NULL, '2014-05-01 21:15:12', NULL),
	(10, 5, 709, 'Code completion?', 'Hi,\nI can see that you\'ve managed to get code completion going in Sublime Text. I\'ve been struggling this for weeks now, and simply cannot get it to work. Would you be able to help with this issue? I\'ve been googling like mad, and tried everything possible and asked question at the phalcon forums, but none have been able to help. I simply cannot get these stub files added for Sublime Text to see them ...', NULL, 0, NULL, '2014-05-28 09:35:15', NULL),
	(11, 2, 1575, 'source code?', 'I wish there was source code available at more points in the course, perhaps to conclude every chapter, after getting stuck badly at some points. I am almost finished with Chapter 8, and plan to follow with Punch in the Face, to try and cement these ideas down.', NULL, 0, NULL, '2014-09-17 14:49:03', NULL),
	(12, 2, 1970, 'Add the ability to have a dropdown list box populated with a query.', 'I would like to add a dropdown box to the register_view between username and password called usertype.  The purpose of usertype is to add another level of security to file insertion, update and delete for unauthorized users.  For example, only certain usertypes can delete a note.  In other to limit the choices for usertype, I would like to fill a dropdown list with values from a MySQL table, usertype and a field called userType.  I have extensively search google selections, but nothing seems to clearly outline the steps.  Any suggestions or pointers to where I can find the answer?  Thx John k', NULL, 0, NULL, '2014-10-10 02:50:53', NULL),
	(13, 2, 2471, 'using the php codeigniter videos off line', 'Hi Just purchased your PHP codeigniter tutorials, is there any possibility of having a downloaded copy, I am not online at home, but have lamp server setup on my pc, so I can use CI without having the internet and go through the tutorials.\n\nGlyn\n', NULL, 0, NULL, '2014-10-10 10:51:33', NULL),
	(14, 2, 2359, 'Missing content?', 'Are you missing content between lessons 6.1 and 6.2? The first couple of minutes show input controls that we haven\'t covered yet, and you cut and paste from a file that hasn\'t been created as yet (dashboard.js). While I can probably reconstruct it, I\'m wondering if we are missing out on important reasoning / context. Cheers.', NULL, 0, NULL, '2014-10-14 02:35:42', NULL),
	(15, 2, 2359, '9.7 - additional steps', 'Just a heads up - at the end of 9.7, during the code cleanup - we move some files around, then fix the links in the home page (header file) to reference those files. In the video the home page is reloaded and everything works fine. However, these steps also need to be done on the dashboard application header file, otherwise when you log in, most of the app will no longer work. Simple fix - just confusing at first. ;)', NULL, 0, NULL, '2014-10-21 07:28:47', NULL),
	(16, 5, 828, 'Phalcon ACL', 'Hi,\nI downloaded the code at BitBucket. However, it does not seem to contain the application as per the video. IS there another repository ?\n\nMy BitBucket download showed a simple Phalcon dir structure and was missing the config dir.\n\nThat said, I have had no problems with following until the ACL.  The Permission class is instantiated, but  a var_dump always ends with : \nUnexpected value type: expected object implementing Phalcon\\DispatcherInterface, boolean given\n\nFinally, I have had a look at the official docs to get a better idea on debugging. I\'m used to \'tailing\' php errors ... but run into blanks : no error / no page rendered. Any suggestions or one of your enlightening tuts on the Exception class would sure help.\n\n\n\n\n\n', NULL, 0, NULL, '2014-12-10 10:13:02', NULL),
	(17, 1, 3398, '9.6 File And Session Messages', 'Hi just almost finished watching all your php videos PHP Punch in the Face and 9.6 File And Session Messages is not this it is creating an update user form .\nWhat have i missed', NULL, 0, NULL, '2015-02-04 12:02:32', NULL),
	(18, 2, 3932, 'Net Beans Theme', 'First off I just want to say thank you for these lessons, they are great and easy to follow. You do a very good job of explaining things. I was just curious if you could provide a copy of your Net Beans Theme. Sounds weird but I find it very pleasing to the eyes and I think it would make it easier to follow along if I were using the same theme. If not, no big deal, just figured I would ask. Keep creating great content!', NULL, 0, NULL, '2015-03-10 19:56:13', NULL),
	(19, 2, 3885, 'populate a combo box with database', 'I understand the theory of MVC, but i\'m really confused how can i populate a combo box with a database field. For what i understand, you have a controller that will get the querie from the model, but how can you pass that valor to the combobox, filling all the option?', NULL, 0, NULL, '2015-03-13 12:53:46', NULL),
	(20, 2, 4817, 'Stuck on 8.4 with deletion problem', 'After refactoring  the code in the api.php file in 8.4, I get an error when trying to delete from the dashboard. When I click the X on the dashboard this is my result:{"result":0,"message":"Could not delete"} and nothing else on screen.\nI have compared my crud_model.php, api.php, user_model and todo_model with yours and they match. Everything worked up to this point.  Any ideas?', NULL, 0, NULL, '2015-07-07 19:41:47', NULL),
	(21, 10, 1442, 'Some general questions', 'Amazing job man, I am following you from your Youtube Videos in some MVC php lessons.You taught me a lot.\n\n1)Do you plan to add Terminals commands for Linux especially for Server Administration and Networking? \n2) Will you do a lesson to build custom restfull api based on a framework like Slim or \nin pure php ?\n\nWith Respect', NULL, 0, NULL, '2015-12-30 21:10:01', NULL),
	(22, 5, 6013, 'install phalcon, amazon linux', 'Hello,\nI can not install phalcon with amazon ec2, I have the following error:\ngit clone git://github.com/phalcon/cphalcon.git\ncd cphalcon/build\nsudo ./install\nPhp-config is not installed \nCan you help me please ?', NULL, 0, NULL, '2017-06-05 18:34:59', NULL);
INSERT INTO `product_thread_reply` (`id`, `product_thread_id`, `user_id`, `content`, `content_code`, `is_deleted`, `deleted_at`, `created_at`, `updated_at`) VALUES
	(2, 1, 15, 'It seems this has been a common problem for several people. If you cannot construct new Result(), then Result() is not being included. To test it on its own you can open Chrome > Console and type new Result(). If it creates then it\'s correct, if not it\'s not included. So if it\'s creating, then the way it\'s being called from the Dashboard js is not correct.', NULL, 0, NULL, '2014-03-10 01:08:59', NULL),
	(3, 2, 709, 'Digging further into it, it seems the problem lies around the $user->save() method. Not getting any errors though.', NULL, 0, NULL, '2014-04-26 22:26:12', NULL),
	(4, 2, 15, 'It sounds like you probably have a value missing when it\'s required because the database record not NULL.\r\n\r\nYou are right in assuming User would relate to the user table automatically.\r\n\r\nIf you run the following code below it should give you an error. You have to die() out of the application or else it won\'t output a print_r. Let me know if this tells you:\r\n\r\n    $user = new \\User();\r\n    $user->role = \'user\';\r\n    $user->email = \'test@test.com\';\r\n    $user->create(); \r\n    print_r($user->getMessages());\r\n    die;', NULL, 0, NULL, '2014-04-27 00:53:47', NULL),
	(5, 2, 709, 'That didn\'t make any difference, unfortunately. It seems I can\'t get passed the $user->save() ( or in your case $user->create(), which I copy pasted ) part.\r\n\r\nThe die(); doesn\'t print out anything either. I can echo out stuff before the $user->save() but not after, so it\'s dying somewhere in there.\r\n\r\nI\'m running Phalcon 1.3.0. Iis this series covering that version or some prior version, which could make things work differently?\r\n\r\nAnd could I somehow add functionality to the empty User model for debugging what it\'s actually doing? It\'s one of those things that\'s always made me uncomfortable using other peoples frameworks, as I have no sense of what\'s going on inside.', NULL, 0, NULL, '2014-04-27 09:00:01', NULL),
	(6, 2, 709, 'And by the way; do I have to put a backslash before User in creating a new \\User()? Not that it makes any difference in my case.', NULL, 0, NULL, '2014-04-27 09:04:02', NULL),
	(7, 2, 709, 'Problem solved: My typing was ok, just not the order. I had:\r\n\\Phalcon\\Adapter\\Db\\Pdo\\Mysql\r\ninstead of:\r\n\\Phalcon\\Db\\Adapter\\Pdo\\Mysql\r\n\r\nHard figuring out with no errors getting thown in my face.\r\n\r\nSorry for the confusion, and thanks for making a great series.', NULL, 0, NULL, '2014-04-27 09:36:47', NULL),
	(8, 9, 15, 'Thats really weird. Try copy pasting this URL: https://jream.com/dashboard/course/view/5/173  Im looking for a fix', NULL, 0, NULL, '2014-05-02 01:45:59', NULL),
	(9, 9, 15, 'This has been fixed, the bug was due to a jQuery popover double quote. ', NULL, 0, NULL, '2014-05-02 03:57:22', NULL),
	(10, 8, 15, 'What does your apache config for this setup look like?', NULL, 0, NULL, '2014-05-02 03:58:25', NULL),
	(11, 10, 15, 'What version are you using? And what OS? I have people using Linux and Mac that do not have an issue. So take a look at my EXACT Sublime setup here:\r\n\r\n   https://bitbucket.org/JREAM/sublime-settings/src\r\n\r\nI am using "SublimeCodeIntel"  for Code Compleition. Also, make sure your file is saved as the proper extension, like you have a file.php saved otherwise I don\'t think CodeCompletion does anything unless it knows the file.\r\n', NULL, 0, NULL, '2014-05-28 13:38:02', NULL),
	(12, 11, 15, 'Hey William, all code is available on BitBucket (https://bitbucket.org/jream-media/learn-codeigniter/src/) It is linked in the main listing of the course. I understand what you mean, I wish I could have done it differently with files after each section/conlcusion. That\'s a good idea. The problem is that this takes so long to record and plan that I admit your suggestion is a very good idea.', NULL, 0, NULL, '2014-09-17 14:52:37', NULL),
	(13, 12, 15, 'Make another table called user_type with one column called type, make that the primary key.\r\n\r\nThen add a field in user called type and make it a foreign key to user_type using the column type.\r\n\r\nThis allows you to add more types later and not repeat it in SQL.\r\n\r\nYou would get the list via: select type from user_type.\r\n\r\nTry it that way. And set a few user_type\'s to populate your users.', NULL, 0, NULL, '2014-10-10 03:35:55', NULL),
	(14, 14, 15, 'You haven\'t missed a thing, unfortunately this gets asked a lot and I usually point people to the code. I can\'t seem to figure out how I glazed over this part.', NULL, 0, NULL, '2014-10-14 04:00:00', NULL),
	(15, 14, 2359, 'Hah hah - okay - no worries. I was more concerned that I\'d lost the plot and missed something. Thanks for the quick response. :)', NULL, 0, NULL, '2014-10-14 04:13:43', NULL),
	(16, 14, 15, 'The CI course took a wild turn into JS, but I figured it\'d be kind of interesting learning 2 topics in one. It just made it very difficult to record. These long courses take me about 2-3 months to record and make a project -- It may not seem like it, but it\'s hard to find time and think of a practical way to explain something without it being too boring :D', NULL, 0, NULL, '2014-10-14 04:25:46', NULL),
	(17, 14, 2359, 'I\'ve looked at a lot of PHP courses, and yours I\'ve found to be the most engaging and consistently informative. I think a lot of people providing course material forget that context is important, and that\'s what I get from your material. A good, straight forward explanation as to why you are architecting it in a certain way. Plus, the brief moments of refactoring are fascinating - because it helps reinforce the design choices along the way. Anyway - really looking forward to the Professional PHP course. ;)', NULL, 0, NULL, '2014-10-14 04:45:16', NULL),
	(18, 16, 828, 'Oops ... re cloned an have the Fireball branch now.', NULL, 0, NULL, '2014-12-12 23:25:30', NULL),
	(19, 17, 15, 'Hey! I was rewatching this video, it\'s a bit fast paced -- Near the end, you copy/paste the code to display errors. It looks like I missed adding a session message. This was my first full series, and I made the mistake of saying "whats next", when people would want other parts added it made it a big mess to say "This is next at the end". So I do not have a $_SESSION message video, I actually should rename this and cut off the end. A $_SESSION message it basically a message that "Flashes" for one page refresh, and not after that. This is not something to worry about much because when you move up in PHP you\'ll use a library that has "flash" built in, this is inside Phalcon, CodeIgniter, Laravel, Symfony, you name it. :)', NULL, 0, NULL, '2015-02-04 18:06:08', NULL),
	(20, 18, 15, 'Thanks! I haven\'t used that theme in a while but most commonly the theme I used in called Monakai. \r\n\r\nThere is a GUI theme (Which I didnt use)\r\nhttp://plugins.netbeans.org/plugin/40985/ez-on-da-ice\r\n\r\nBut you can find a color scheme you like more here:\r\nhttp://netbeansthemes.com/\r\n\r\nGo to Tools -> Options then select Import and browse to the .zip file. Click Okay and restart the IDE', NULL, 0, NULL, '2015-03-10 20:18:44', NULL),
	(21, 21, 15, 'Hey Im glad it helped! \r\n1) I have been recording a series on using Ubuntu and setting up a development server. It has 10 videos so far and it\'s over an hour long in total so far. I feel like I wen\'t a bit unorganized in it so I\'m not sure what to do yet.\r\n2) Probably not a restful framework series, I have a Django one 60% done. I think after the Ubuntu and Django I might do an Ansible server provisioner one.  However, a RESTful API is very easy in a framework such as slim -- all you\'d need are your end-points, database connection, and document generator (like phinx in python).', NULL, 0, NULL, '2015-12-31 15:50:35', NULL),
	(22, 22, 15, 'Hey Khaled,\r\n\r\nAmazon AMI is based on RHEL (RedHat), so you would not build it differently. Phalcon now has easy install scripts, you should try this for v3.x.\r\n\r\nThis should also resolve all dependencies:\r\n```\r\ncurl -s https://packagecloud.io/install/repositories/phalcon/stable/script.rpm.sh | sudo bash\r\n```\r\n\r\nThen depending on your `php --version` install phalcon for 5 or 7:\r\n```\r\n# For PHP5.X\r\nsudo yum install php56u-phalcon\r\n\r\n#For PHP 7.0 (It doesnt work with 7.1 yet)\r\nsudo yum install php70u-phalcon\r\n```\r\n\r\nKeep in mind Phalcon 3.X has some breaking changes, It\'s caused me a lot of trouble on this site (It\'s built in Phalcon) when I upgraded. However, I have a TON of code here and some special cases. I\'d say atleast 95% of what I taught in this course will work in Phalcon 3.x so that\'s good news.\r\n\r\nI generally use Ubuntu, but please try that.\r\n- Jesse', NULL, 0, NULL, '2017-06-05 18:46:09', NULL);
