INSERT INTO `youtube` (`id`, `title`, `description`, `video_id`, `img_sm`, `img_md`, `img_lg`, `is_deleted`, `deleted_at`, `created_at`, `updated_at`) VALUES
	(1, 'FrontEnd Skills with Gulp (Part 1)', '<p>This is a multi-part series. First we setup the initial items for gulp. We will then\r\ntweak it in the second video to run smoothly. We are not done in this video!</p>\r\n\r\nFollow Dan Sackett @ <br>\r\nTwitter: https://twitter.com/dansackett/<br>\r\nGithub:  https://github.com/dansackett  (See his front-end-goodness too)<br><br>\r\n\r\nProject Files:<br>\r\nGit: https://github.com/JREAM/learning-gulp  (See Tags)<br>', 'No-r-7I1BCQ', 'https://i.ytimg.com/vi/No-r-7I1BCQ/default.jpg', 'https://i.ytimg.com/vi/No-r-7I1BCQ/mqdefault.jpg', NULL, 0, NULL, NULL, NULL),
	(2, 'FrontEnd Skills with Gulp (Part 2)', '<p>We configure Gulp to streamline our tasks automatically. We have a working Gulp setup now. There are many other things you can do, hint: Checkout NPM Browserfy :)\r\n</p>\r\nProject Files:<br>\r\nGit: https://github.com/JREAM/learning-gulp', '7U6KSOWF2Mo', 'https://i.ytimg.com/vi/7U6KSOWF2Mo/default.jpg', 'https://i.ytimg.com/vi/7U6KSOWF2Mo/mqdefault.jpg', NULL, 0, NULL, NULL, NULL),
	(3, 'FrontEnd Skills with Gulp (Part 3)', '<p>Here we will use Browserify to auto-reload CSS/JS/HTML on the fly. This will\r\nchange your life if don\'t know about it.</p>\r\n\r\nRepository: https://github.com/JREAM/learning-gulp', 'GYJmLBt4nRY', 'https://i.ytimg.com/vi/GYJmLBt4nRY/default.jpg', 'https://i.ytimg.com/vi/GYJmLBt4nRY/mqdefault.jpg', NULL, 0, NULL, NULL, NULL);
